        "content": {
            "text": "SciClaim provides the largest number of fine-grained label types among comparable datasets.Table 1 shows SciClaims remarkable label den-sities per word. SciClaim also contains 81.88%as many total labels as SciERC and more total la-bels than SemEval 2017 task 10 and 2018 task7. On the other hand, SciREX utilizes distant su-pervision from an existing knowledge base andnoisy automatic labeling trained on SciERC to pro-vide an order of magnitude more labels and anno-tate complete documents. This is one example ofhow smaller yet more densely and directly labeleddatasets like SciERC and SciClaim can enable andcompliment larger, higher-level corpora.Meanwhile, our dataset also focuses on scien-tific claims. Some previous work identifies claimswithin scientific texts (Wadden et al., 2020; Gel-man et al., 2021), but does not extract the relationsand factors within the claims themselves. Otherrecent symbolic semantic NLP systems do modelrelational representations of scientific claims (e.g.,Friedman et al., 2017), but these approaches relyon rule-based engines with hand tuning, which re-quire NLP experts to maintain and adapt to newdomains. Instead we modify SpERT (Eberts andUlges, 2020), a transformer-based method that hasbeen shown to effectively extract relational scien-tific information on SciERC (Luan et al., 2018).We extend this model to accommodate our ad-ditional multi-label attributes and apply it to ourclaim graph extraction task."
        },
