        "content": {
            "text": "Relations are directed edges between labeledentities in SciClaim graphs. They are critical forexpressing what-goes-with-what over the set of en-tities. Note that in Figures 1 and 2 the unlabeledarrows are all modifier relations, left blank to avoidclutter. We encode six relations: arg0 relates anassociation to its cause, antecedent, subject, or inde-pendent variable (e.g., levels of social support inFigure 1). arg1 relates an association to its result ordependent variable (e.g., self-efficacy and stressin Figure 1). comp_to is an explicit frame of ref-erence in a comparative association (e.g., controlgroup in Figure 3). subtype relates a head en-tity to a subtype tail (e.g., stillbirth as a subtypeof pregnancy outcome). modifier relates asso-ciations to qualifiers, magnitudes, epistemics, andevidence (e.g., all unlabeled arrows in Figure 1 andFigure 2). q+ and q- indicate positive and nega-tive qualitative proportionality, respectively, whereincreasing the head factor increases or decreasesthe tail factor, respectively (e.g., levels of socialsupport is q+ to sleep quality and q- to stressin Figure 1)."
        },
