        "content": {
            "text": "Entities are labeled text spans. The same ex-act span cannot correspond to more than one en-tity type, but two entity spans can overlap. Enti-ties comprise the nodes of SciClaim graphs uponwhich attributes and relations are asserted. Ourschema includes six entity types: Factors are vari-ables that are tested or asserted within a claim (e.g.,sleep quality in Figure 1). Associations are ex-plicit phrases associating one or more factors (e.g.,higher Figure 3). Magnitudes are modifiers ofan association indicating its likelihood, strength,or direction (e.g., significantly and negativelyin Figure 1). Evidence is an explicit mention ofa study, theory, or methodology supporting an as-sociation (e.g., our SEIR model). Epistemicsexpress the belief status of an association, oftenindicating whether something is hypothesized, as-sumed, or observed (e.g., predicted in Figure 2).Qualifiers constrain the applicability or scope ofan assertion (e.g., for medical staff  in Figure 1)."
        },
